create table utenti (
    id       int auto_increment
        primary key,
    username varchar(50)                           not null,
    email    varchar(100)                          not null,
    password varchar(40)                           not null,
    ruolo    enum ('Amministratore', 'Moderatore') null,
    constraint email
        unique (email),
    constraint username
        unique (username)
);

