create table videogiochi (
    id             int auto_increment
        primary key,
    titolo         varchar(100) not null,
    anno           year         not null,
    software_house int          not null,
    constraint videogiochi_ibfk_1
        foreign key (software_house) references software_houses (id)
            on update cascade
);

create index software_house
    on videogiochi (software_house);

