create table giocate (
    utente     int                                not null,
    videogioco int                                not null,
    momento    datetime default CURRENT_TIMESTAMP not null,
    voto       float                              null,
    primary key (utente, videogioco),
    constraint giocate_ibfk_1
        foreign key (utente) references utenti (id)
            on update cascade,
    constraint giocate_ibfk_2
        foreign key (videogioco) references videogiochi (id)
            on update cascade
);

create index videogioco
    on giocate (videogioco);

