create table videogiochi_descrizioni (
    videogioco  int  not null
        primary key,
    descrizione text not null,
    constraint videogiochi_descrizioni_ibfk_1
        foreign key (videogioco) references videogiochi (id)
            on update cascade
);

INSERT INTO moovie.videogiochi_descrizioni (videogioco, descrizione) VALUES (1, 'In viaggio verso l''India, il Principe di Persia, figlio del grande re persiano Shahraman, ha l''occasione di partecipare alla sua prima grande battaglia contro una potente citt. Come premio per la vittoria conquistata, i persiani riducono in schiavit gli abitanti (tra cui la bellissima Farah, figlia del Maharajah) e saccheggiano le locali stanze del tesoro, ricche di antichi manufatti come una grande Clessidra contenente le mitiche Sabbie del Tempo e un mistico Pugnale in grado di piegare il tempo ai voleri di chi lo possiede.');
INSERT INTO moovie.videogiochi_descrizioni (videogioco, descrizione) VALUES (2, 'Sono passati sette anni dall''avventura di Azad, durante la quale il Principe ha usato il potere delle Sabbie del Tempo per riavvolgere il corso degli eventi e sfuggire al proprio destino. Proprio per questo motivo il Principe si ritrova braccato dal Dahaka, il leggendario Guardiano del Tempo, una bestia spaventosa il cui compito  fare in modo che la storia segua il suo giusto corso.');
INSERT INTO moovie.videogiochi_descrizioni (videogioco, descrizione) VALUES (3, 'I Due Troni  il seguito di Spirito Guerriero, nel quale il Principe uccide il Dahaka e riesce con successo ad alterare il destino di Kaileena (L''Imperatrice del Tempo). Mentre sono su una nave in rotta per la sua citt natale, Babilonia, il Principe getta il suo medaglione magico fuori bordo, credendo che non gli servir. Aveva promesso a Kaileena che nessuno le avrebbe fatto del male a Babilonia, ma mentre ritornano, rimane inorridito nel trovare la citt messa a ferro e fuoco. La sua nave  attaccata e lui e Kaileena vengono gettati fuori bordo. Kaileena viene fatta prigioniera dopo essere naufragati sulla spiaggia.');
INSERT INTO moovie.videogiochi_descrizioni (videogioco, descrizione) VALUES (4, 'La storia di Assassin''s Creed inizia nel settembre del 2012, quando un barista di nome Desmond Miles, si risveglia dopo una sessione difettosa dell''Animus (uno speciale macchinario) all''interno dei laboratori delle Industrie Abstergo a Roma dopo essere stato rapito. Desmond  stato "scelto" per il progetto per via del suo antenato Altar, un membro della setta degli Assassini vissuto durante la Terza Crociata in Terra Santa; i dirigenti dell''Abstergo mostrano particolare interesse su qualcosa con cui ha avuto a che fare Altar e vorrebbero saperne di pi.');
create table visioni (
    utente  int                                not null,
    film    int                                not null,
    momento datetime default CURRENT_TIMESTAMP not null,
    voto    float                              null,
    primary key (utente, film),
    constraint visioni_ibfk_1
        foreign key (utente) references utenti (id)
            on update cascade,
    constraint visioni_ibfk_2
        foreign key (film) references films (id)
            on update cascade
);

create index film
    on visioni (film);

